import React from "react";
import { AppBar, Toolbar, Typography } from "@mui/material";

class TopBar extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: props.name,
        }
    }

    render() {
        return (
            <AppBar className="cs142-topbar-appBar" position="absolute" style={{background: "#001f3f"}}>
                {this.state.name}
            </AppBar>
        )
    }
}

export default TopBar;
